CODE    SEGMENT 'CODE' 
        ASSUME DS:DATA0, DS:DATA1, DS:DATA2, DS:DATA3, DS:DATA4, DS:DATA5, DS:DATA6, DS:DATA7, DS:DATA8, DS:DATA9, DS:DATA10, DS:DATA11, DS:DATA12, DS:DATA13, DS:DATA14, CS:CODE, SS:STACK

START:
        MOV AX, DATA0
        MOV DS, AX

        MOV AX, STACK
        MOV SS, AX

        MOV AX, TOP
        MOV SP, AX

        CALL LCD_INIT  ;LCD初始化
        CALL LCD_CLEAR  ;LCD清屏


TCONT:  MOV DX, TCONTRO
        MOV AL, 36H  ;计数器0，只写计算值16位，方式3，二进制计数
        OUT DX, AL
        MOV DX, TCON0
        MOV AX, 0  ;写计数值为0
        OUT DX, AL
        MOV AL, AH
        OUT DX, AL



MAINLOOP:

        MOV BX, 0  ;全部计数变量清零
        MOV DS:MUSIC_PTR, BX
        MOV DS:SER_PTR, BL
        MOV DS:IMG_PTR0, BL
        MOV DS:IMG_PTR1, BL
        MOV DS:IMG_PTR2, BL
        MOV DS:IMG_PTR3, BL

        CALL WRHD0  ;开头动画1-50帧
        CALL WRHD1  ;开头动画51-100帧
        CALL WRHD2  ;开头动画101-150帧
        MOV CX, 00A0H
        CALL DELAY2  ;延时
        CALL LCD_CLEAR  ;LCD清屏
        MOV CX, 0080H
        CALL DELAY2  ;延时
        CALL WRSTR_BA  ;写字符串BA
        MOV CX, 01A0H
        CALL DELAY2  ;延时
        CALL LCD_CLEAR  ;LCD清屏
        MOV CX, 00C0H
        CALL DELAY2  ;延时

        CALL WRIMG0   ;视频1-90帧
        CALL WRIMG1   ;视频91-190帧
        CALL WRIMG2   ;视频191-290帧
        CALL WRIMG3   ;视频291-390帧
        CALL WRIMG4   ;视频391-490帧
        CALL WRIMG5   ;视频491-590帧
        CALL WRIMG6   ;视频591-690帧
        CALL WRIMG7   ;视频691-790帧
        CALL WRIMG8   ;视频791-890帧
        CALL WRIMG9   ;视频891-990帧
        CALL WRIMG10  ;视频991-1090帧
        CALL WRIMG11  ;视频1091-1155帧

        MOV CX, 0060H
        CALL DELAY2  ;延时
        CALL LCD_CLEAR  ;LCD清屏
        MOV CX, 0200H
        CALL DELAY2  ;延时

        JMP MAINLOOP







LCD_INIT:        
        MOV DX, LCD_RST
        OUT DX, AL

        MOV AL, 00H
        MOV DX, LCD_RST_OK
        OUT DX, AL

        IN  AL, DX    

        MOV AL, LCD_ROW
        CALL WRCMD

        MOV AL, LCD_COLUMN
        CALL WRCMD

        MOV AL, LCD_PAGE
        CALL WRCMD
        
        MOV AL, 3FH
        CALL WRCMD
        RET
        
LCD_CLEAR:
        MOV BL, 00H
LC_LOOP:MOV AL, BL
        ADD AL, LCD_PAGE
        CALL WRCMD
        MOV AL, LCD_COLUMN
        CALL WRCMD
        MOV CX, LCD_COLUMN_MAX
        MOV AL, 00H
        MOV DX, LCD_DATA_WR0
LC_WDATA:
        OUT DX, AL
        LOOP LC_WDATA
        INC BL
        CMP BL, LCD_PAGE_MAX
        JL LC_LOOP
        RET

WRCMD:  PUSH DX
        MOV DX, LCD_CMD_WR
        OUT DX, AL
        POP DX
        RET

;;顶层功能函数
WRSTR_BA:
        MOV AX, 10
        MOV CX, 3
        MOV BX, 032CH
        LEA DI, SPACE1
WRSTR_LOOP1:
        CALL WRCHAR
        ADD BX, AX
        ADD DI, 20
        LOOP WRSTR_LOOP1
        RET



WRSTR_SER:
        PUSH AX
        PUSH BX
        PUSH CX
        PUSH DI
        MOV AX, DS
        PUSH AX
        MOV AX, DATA0
        MOV DS, AX

        MOV CX, 0
        MOV CL, DS:SER_PTR
        MOV AX, 30
        MOV BX, 015BH
        LEA DI, SER1_ENT
        ADD DI, CX
        CALL WRSER

        INC BH
        LEA DI, SER2_ENT
        ADD DI, CX
        CALL WRSER

        INC BH
        LEA DI, SER3_ENT
        ADD DI, CX
        CALL WRSER

        ADD CL, 2
        CMP CL, 158  ;MAX162
        JZ SER_PTR_CLR
        MOV DS:SER_PTR, CL
SER_CONT1:
        POP AX
        MOV DS, AX
        POP DI
        POP CX
        POP BX
        POP AX
        RET

SER_PTR_CLR:
        MOV CL, 0
        MOV DS:SER_PTR, CL
        JMP SER_CONT1



WRSTR_NUM:
        PUSH AX
        PUSH BX
        PUSH CX
        PUSH DX
        PUSH SI
        PUSH DI
        MOV AX, DS
        PUSH AX
        MOV AX, DATA0
        MOV DS, AX

        MOV BX, 0551H
        LEA DI, SPACE1
        MOV AX, 8
        CALL WRNUM
        ADD BX, 8

        MOV AL, DS:IMG_PTR3
        MOV AH, 0
        MOV CL, 8
        MUL CL
        MOV SI, AX
        LEA DI, ZF_N0[SI]
        MOV AX, 8
        CALL WRNUM
        ADD BX, 8

        MOV AL, DS:IMG_PTR2
        MOV AH, 0
        MOV CL, 8
        MUL CL
        MOV SI, AX
        LEA DI, ZF_N0[SI]
        MOV AX, 8
        CALL WRNUM
        ADD BX, 8

        MOV AL, DS:IMG_PTR1
        MOV AH, 0
        MOV CL, 8
        MUL CL
        MOV SI, AX
        LEA DI, ZF_N0[SI]
        MOV AX, 8
        CALL WRNUM
        ADD BX, 8

        MOV AL, DS:IMG_PTR0
        MOV AH, 0
        MOV CL, 8
        MUL CL
        MOV SI, AX
        LEA DI, ZF_N0[SI]
        MOV AX, 8
        CALL WRNUM

        POP AX
        MOV DS, AX
        POP DI
        POP SI
        POP DX
        POP CX
        POP BX
        POP AX
        RET





