;入口参数：
;AX-->字符宽度，ASCII为8，汉字为16
;BL-->X地址，0-127
;BH-->Y地址，0-7
;DI-->字符首地址
WRSER:  PUSH AX
        PUSH BX
        PUSH CX
        PUSH DX
        PUSH DI
        MOV CX,AX
        MOV AH, 01H
        ADD BL, LCD_COLUMN
        ADD BH, LCD_PAGE
WRSER_P:
        MOV AL,BH
        CALL WRCMD
        TEST BL, 80H
        JNZ  WRSER_P0
        MOV AL, BL
        CALL WRCMD
        MOV DX, LCD_DATA_WR1
        JMP WRSER_P1
WRSER_P0:
        MOV AL, BL
        SUB AL, 40H
        CALL WRCMD
        MOV DX, LCD_DATA_WR2
WRSER_P1:
        PUSH CX
WRBIT0: MOV AL, [DI]
        OUT DX, AL
        INC DI
        LOOP WRBIT0
        POP CX
        INC BH
        MOV AL,00H
        XCHG AL,AH
        DEC AX
        XCHG AL,AH
        JNZ WRSER_P
        POP DI
        POP DX
        POP CX
        POP BX
        POP AX
WRRET0: RET


