SING:
        PUSH AX
        PUSH BX
        PUSH DX
        PUSH DI
        MOV AX, DS
        PUSH AX
        MOV AX, DATA0
        MOV DS, AX

        MOV AL, DS:MUSIC_CHG
        CMP AL, 0
        JZ SING_END
        MOV AL, 0
        MOV DS:MUSIC_CHG, AL

        MOV DX, TCON0
        MOV BX, DS:MUSIC_PTR
        MOV DI, BX
        MOV AL, DS:MUSIC_000[DI]
        MOV AH, 0
        MOV DI, AX
        ADD DI, AX
        MOV AX, DS:MUSIC_LOW[DI]

        OUT DX, AL
        MOV AL, AH
        OUT DX, AL

        MOV BX, DS:MUSIC_PTR
        INC BX
        CMP BX, 591
        JZ MUSIC_PTR0
        MOV DS:MUSIC_PTR, BX
        
        POP AX
        MOV DS, AX
        POP DI
        POP DX
        POP BX
        POP AX
        RET

MUSIC_PTR0:
        MOV BX, 0
        MOV DS:MUSIC_PTR, BX
SING_END:
        MOV AL, 1
        MOV DS:MUSIC_CHG, AL
        POP AX
        MOV DS, AX
        POP DI
        POP DX
        POP BX
        POP AX
        RET


ADD_IMGPTR:
        PUSH AX
        MOV AX, DS
        PUSH AX
        MOV AX, DATA0
        MOV DS, AX

        MOV AL, DS:IMG_PTR0
        INC AL
        CMP AL, 0AH
        JZ ADD_PTR1
        MOV DS:IMG_PTR0, AL
ADD_CONT1:
        POP AX
        MOV DS, AX
        POP AX
        RET

ADD_PTR1:
        MOV AL, 0
        MOV DS:IMG_PTR0, AL
        MOV AL, DS:IMG_PTR1
        INC AL
        CMP AL, 0AH
        JZ ADD_PTR2
        MOV DS:IMG_PTR1, AL
        JMP ADD_CONT1

ADD_PTR2:
        MOV AL, 0
        MOV DS:IMG_PTR1, AL
        MOV AL, DS:IMG_PTR2
        INC AL
        CMP AL, 0AH
        JZ ADD_PTR3
        MOV DS:IMG_PTR2, AL
        JMP ADD_CONT1

ADD_PTR3:
        MOV AL, 0
        MOV DS:IMG_PTR2, AL
        MOV AL, DS:IMG_PTR3
        INC AL
        MOV DS:IMG_PTR3, AL
        JMP ADD_CONT1



DELAY1: NOP
        NOP
        LOOP DELAY1
        RET

DELAY2: PUSH AX
        MOV AX, 00FFH
DELAY22:DEC AX
        JNZ DELAY22
        POP AX
        LOOP DELAY2
        RET

